const NavBar = ()=>{
    return (
        <>
            <NavLink activeClassName = 'active_class' to="/" onlyActiveOnIndex> Home </NavLink>
            <NavLink activeClassName = 'active_class' to="/about" onlyActiveOnIndex> About </NavLink>
            <NavLink activeClassName = 'active_class' to="/contact" onlyActiveOnIndex> Contact </NavLink>
            <NavLink activeClassName = 'active_class' to="/contact/name" onlyActiveOnIndex> Name </NavLink>

            {/* <a href="/">home</a>
            <a href="/about">About</a>
            <a href="/contact">Contact</a>
            <a href="/contact/name"> Name </a>  */}
        </>
    )
}

export default NavBar;
